const CLIENT_SECRET = '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'
const API_KEY = 'AIzaSyACC4PzlIDmujM96bpcMEZyG-FH43Iq8Nw'
const SCOPES = 'https://photoslibrary.googleapis.com/v1/'
