  const fetchFestivals = async() => {
    try{
      const response = await axios.get('https://www.googleapis.com/drive/v3/about')
      console.log(response)
    }
    catch(error){
      console.log(error)
    }
  }
  return (
    <div className="App">
      <button onClick={fetchFestivals}>get</button>
    </div>
  );
}

export default App;
